syntax = "proto2";

package MMPro.micromsg;


message SnsExtStatData {
	optional uint32  _FirstRequestTime = 1;
	optional uint32  _CurrentRequestTime = 2;
	optional uint32  _RetryTimes = 3;
	optional uint32  _RetryScene = 4;
	optional uint32  _ErrCodeCount = 5;
	repeated uint32  _ErrCodeListList = 6;
}